import {useEffect, useState} from 'react'

export default function Perfil () {
    const [name, setName] = useState('')
    useEffect(() => {
        setName(localStorage.getItem('namePerfil'))
    },[])
    return (
        <div>
            {name}
        </div>
    )
}
